import React from 'react';

export default function Card() {
  return (
    <div className="relative w-72 h-40 rounded-2xl bg-gray-100 p-4 shadow-lg transform transition-transform duration-500 hover:scale-105 overflow-visible">
      <div className="h-full grid place-content-center text-center">
        <p className="text-2xl font-bold text-gray-800">Projetos</p>
        <p className="text-gray-600 mt-2">Confira meus projetos recentes.</p>
      </div>
      <button className="absolute left-1/2 bottom-0 transform -translate-x-1/2 translate-y-1/2 opacity-0 hover:opacity-100 transition-all duration-300 bg-blue-500 text-white px-4 py-2 rounded-lg font-semibold">
        Ver Mais
      </button>
    </div>
  );
}
